// Вывести все дубли массива, решение с использованием битов и без них
function getRow(bit) {
  return Math.floor(bit >> 4)
}

function getCol(bit) {
  return bit % 16
}

function isSetBit(bitVector, index) {
  const row = getRow(index);
  const col = getCol(index);
  return (bitVector[row] & (1 << col)) !== 0
}

function setBit(bitVector, index) {
  const row = getRow(index);
  const col = getCol(index);
  bitVector[row] |= 1 << col;
}

function inverseBit(bitVector, index) {
  const row = getRow(index);
  const col = getCol(index);
  bitVector[row] ^= (1 << col)
}

function resetBit(bitVector, index) {
  const row = getRow(index);
  const col = getCol(index);
  bitVector[row] &= ~(1 << col)
}

function getDuplicateBit(arr) {
  console.time('getDuplicateBit');
  let read = new Uint16Array(arr.length);
  let duple = [];

  for (let i = 0; i < arr.length; i++) {
    if (isSetBit(read, arr[i] - 1)) {
      duple.push(arr[i])
    } else {
      setBit(read, arr[i] - 1)
    }
  }

  console.timeEnd('getDuplicateBit');
  return duple
}

function getDuplicate(nums) {
  console.time('getDuplicate');
  const read = new Array(nums.length).fill(false);
  const duple = []
  for (let i = 0; i < nums.length; i++) {
    if (read[nums[i] - 1]) {
      duple.push(nums[i])
    } else {
      read[nums[i] - 1] = true
    }
  }

  console.timeEnd('getDuplicate');
  return duple;
}


